import React from "react";
import "./NotFound.scss";
export default function NotFound() {
  return (
    <section class="page_404">
      <div class="container">
        <div class="row">
          <div class="col">
            <div class="four_zero_four_bg">
              <img
                src=""
                alt=""
              ></img>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
